<head>

	<script> path = "../../../../"; </script>
	<script src="../../js/all.js"></script>
	<style> @import "../../skins/default/all.css"; </style>
	<title>|Import ¦{class_name.display}¦|</title>

<!--BEGIN-->

	<article class="import execute error" id="{class_name.path}/import/error">

		<div class="data import error">
			<div class="top message">
				|Could not import| :
				|I do not know which ¦{display}¦ to import|,
				|several of them match this search criteria| :

				<!--search-->
				<li><span class="property">|{@key}|</span> <span class="value">{.}</span></li>
				<!--end-->
			</ul>
			<div class="bottom message">

			</div>
		</div>

<!--END-->
